  false,\n\t\"url\": null,\n\t\"notes\": \"The TIGER/Line shapefiles and related database
  files (.dbf) are an extract of selectedn               geographic and cartographic
  information from the U.S. Census Bureau's Master Address File / Topologically Integrated
  Geographic Encoding and Referencingn               (MAF/TIGER) Database (MTDB).
  \ The MTDB represents a seamless national file with no overlaps or gaps between
  parts, however, each TIGER/Line shapefile isn               designed to stand alone
  as an independent data set, or they can be combined to cover the entire nation.
  The Rails Shapefile includes all features withinn               the MTDB Super Class
  \"Rail Features\" distinguished where the MAF/TIGER Feature Classification Code
  (MTFCC) for the feature in MTDB that begins with \"R\".n               This includes
  main lines such as spur lines, rail yards, mass transit rail lines such as carlines,
  streetcar track, monorail or other mass transit railn               and special
  purpose rail lines such as cog rail lines, incline rail lines and trams.\",\n\t\"license_title\":
